import React, { useState, useEffect } from "react";
import axios from "axios";

const App = (props) => {
    const [data, setData] = useState([]);

  useEffect(() => {
    axios.get("/jobs").then((res) => {
        setData(res.data.response)
    }).catch(err => console.log(`Error in axios request`, err))
  }, [data]);
  return (
    <div>
      <p></p>
    </div>
  );
};
export default App;
